	return gulp.src(['**/*.html', '!src/**', '!node_modules/**']).
		pipe(htmlmin({
			removeComments: true,
			collapseWhitespace: true,
			removeAttributeQuotes: true,
			removeEmptyAttributes: true,
			minifyJS: true,
			minifyCSS: true
		})).
		pipe(gulp.dest('./'));
}

export {
	htmlBundleIcons,
	htmlMinify
};

